import React, { useState } from 'react';
import logo from '../../assets/curis_loogo.png';
import { Nav, NavbarContainer, NavLogo, NavMenu, NavBtn, NavBtnLink } from './NavbarElements';

// import Members from '../../pages/Members';

function Navbar() {
  const [click, setClick] = useState(false);

  const handleClick = () => setClick(!click);
  const cloesMobileMenu = () => setClick(false);

  return (
    <>
      <Nav>
        <NavbarContainer>

          <NavLogo to='/' onClick={cloesMobileMenu} style={{ backgroundImage:`url(${logo})`, backgroundRepeat:'no-repeat', height: 800, backgroundSize: 'contain' }}>
          </NavLogo>

          <NavMenu>

            <NavBtn>
              <NavBtnLink to='/learnMore' onClick={cloesMobileMenu}>Learn More</NavBtnLink>
            </NavBtn>

              <NavBtn>
                <NavBtnLink to='projects' onClick={cloesMobileMenu}>Our Projects</NavBtnLink>
              </NavBtn>

            <NavBtn>
              <NavBtnLink to='members' onClick={cloesMobileMenu}>Meet the Members</NavBtnLink>
            </NavBtn>

            <NavBtn>
              <NavBtnLink to='FAQ' onClick={cloesMobileMenu}>FAQ</NavBtnLink>
            </NavBtn>

          </NavMenu>
          <div className='menu-icon' onClick={handleClick}>
            <i className={click ? 'fa-solid fa-xmark' : 'fa-solid fa-bars'} />
          </div>
        </NavbarContainer>
      </Nav>
    </>
  );
};

export default Navbar;
